/* eslint-disable import/prefer-default-export */
const submit = formData => {
  return fetch('/lookup', {
    method: 'POST',
    body: formData,
  })
    .then(response => response.json())
    .catch(error => {
      console.error(error);
    });
};

export default {submit};
